import React from "react";
import Link from "next/link";
import AppLayout from "../components/AppLayout";
import { Button, DatePicker, version } from "antd";
import "antd/dist/antd.css";

const Home = () => {
  return (
    <>
      <AppLayout>
        <h1>antd version: {version}</h1>
        <Link href="/about">
          <a>about</a>
        </Link>
        <div>Hello, Next!</div>
      </AppLayout>
    </>
  );
};

export default Home;
